"242932":{"id":"242932","name":"Sem Atividade: Itália","slug":"sem-atividade-italia","original_title":"No Activity: Niente da Segnalare","overview":"Dois bandidos aguardam um carregamento importante. Dois policiais montam a tocaia, prontos para a grande apreensão. E duas telefonistas estão a postos para mandar reforços. Mas o carregamento não chega, e todos precisam aguentar uma espera exaustiva e encontrar maneiras de passar o tempo. Enquanto isso, Sem Atividade!","first_air_date":"2024-01-18","episode_run_time":30,"vote_average":6.4,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Valerio Vestoso"],"production_companies":[],"genres":["Comédia"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/ktCtZDqmQwNUYGF2ONNH0QCDI2F.jpg","poster_path":"https://image.tmdb.org/t/p/original/mi1Yv34DJ6n2laHJKZ83E97hjCd.jpg","cast":["Luca Zingaretti","Rocco Papaleo","Carla Signoris","Emanuela Fanelli","Fabio Balsamo"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/6B8LPnX7uupC1t7BzYzGJE2zZ9z.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/6B8LPnX7uupC1t7BzYzGJE2zZ9z.jpg","air_date":"2024-01-18","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Noite nº 9","overview":"Um carregamento importante está chegando... talvez. A adrenalina da tocaia se transforma em uma noite no serviço com os piores colegas possíveis. Mas quando todos baixam a guarda, algo inesperado finalmente acontece.","air_date":"2024-01-18","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/nfTY9xHfM8vMdlk2a2uUyV56gQI.jpg","vote_average":0},"2":{"name":"Noite nº 10","overview":"Marcello fez besteira e agora está sendo investigado pela corregedoria. Felizmente, Achille irá treiná-lo para o depoimento, e um ajudante misterioso pode salvar o dia. Dario é forçado a formar dupla com a última pessoa com quem gostaria de trabalhar: o sobrinho do patrão. Na central, Perri conta a Katia como ela acabou sob observação. Mas teria sido melhor não dizer nada.","air_date":"2024-01-18","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/rn6iF2d3grbz9MpOvFJVwTXN8RF.jpg","vote_average":0},"3":{"name":"Noite nº 14","overview":"Dario e Toni têm um problema para resolver: onde está o sobrinho do patrão? Enquanto isso, Achille e Perri estão com uma dificuldade de comunicação, que seus colegas certamente não ajudam a resolver. Uma ajuda inesperada pode vir de uma testemunha. E assim, com todos ocupados tratando de assuntos pessoais, deixam passar um detalhe crucial do que está acontecendo no porto.","air_date":"2024-01-18","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/zfuHNZl00M95dfGMWCiWEx4sx5a.jpg","vote_average":0},"4":{"name":"Noite nº 17","overview":"Marcello acha que encontrou uma maneira de salvar seu casamento. Perri tenta se libertar de um relacionamento difícil que vai acabar dominando a delegacia toda. Enquanto isso, um telefonema para os bandidos pode precipitar tudo.","air_date":"2024-01-18","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/xGaTmW8AS0jus53eymwOhVdRPhF.jpg","vote_average":0},"5":{"name":"Noite nº 22","overview":"Os policiais, as telefonistas e os bandidos enfrentam seus respectivos chefes. Mas será que é realmente possível ser sincero com seu superior, ou é melhor ficar na sua? Vamos descobrir à medida que a situação fica explosiva para todos.","air_date":"2024-01-18","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/nKIjHS5pLf1QoQ0cO6MC2MUWgYB.jpg","vote_average":0},"6":{"name":"Noite nº 24","overview":"Decepcionados com suas carreiras estagnadas, nossos protagonistas têm duas opções: diminuir suas expectativas ou dar tudo de si. No meio de tudo isso, chega a última noite da tocaia e a esperança de que, pelo menos dessa vez, alguma coisa aconteça...","air_date":"2024-01-18","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/lRp6aSNkLcqtsI8bocRf3iUzeg6.jpg","vote_average":0}}}}},
"257945":{"id":"257945","name":"Vietnã - A Guerra Que Mudou os EUA","slug":"vietna-a-guerra-que-mudou-os-eua","original_title":"Vietnam: The War That Changed America","overview":"A reunião de velhos amigos, relatos em primeira pessoa e filmagens raramente vistas pintam um quadro extraordinário e profundamente profundo de como foi viver uma das guerras mais longas da história.","first_air_date":"2025-01-31","episode_run_time":0,"vote_average":6.2,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":["72 Films"],"genres":["Documentário"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/tpxyzbYvSFTYsYWzLr4Yfr5FDEK.jpg","poster_path":"https://image.tmdb.org/t/p/original/voibNkGlnCavSAahObT5vxFg0q0.jpg","cast":["Ethan Hawke"],"trailer":"krfqB7ZqVRE","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/lJiG3rmP8smQ415jJ0J0SG0sDtU.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/lJiG3rmP8smQ415jJ0J0SG0sDtU.jpg","air_date":"2025-01-31","episode_count":6,"overview":"N/A","vote_average":5,"episodes":{"1":{"name":"Botas no Chão","overview":"Em 1965, os EUA enviam jovens soldados para a guerra em um país totalmente desconhecido por eles. Dois ratos de túnel formam um vínculo poderoso, até que um deles fica gravemente ferido.","air_date":"2025-01-31","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/aDiq0F3nEef92hlPWGRLpk3ZooT.jpg","vote_average":5},"2":{"name":"Revolta","overview":"Guerrilhas comunistas lançam um ataque surpresa: a Ofensiva do Tet. Americanos na cidade de Hue se encontram no meio de uma batalha sangrenta.","air_date":"2025-01-31","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/aZfapR4XPUqiutkoFedzvKXrdwI.jpg","vote_average":0},"3":{"name":"Esta Guerra Não é Minha","overview":"A vida de uma criança vietnamita é destruída pela guerra e um piloto é abatido em território inimigo. Os EUA estão tomados pela agitação social.","air_date":"2025-01-31","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/mknoi419uWXkGzX8JYNM1aW8iBE.jpg","vote_average":0},"4":{"name":"Motim","overview":"Sem expectativas de uma vitória próxima, os soldados americanos começam a perder a fé. Uma enfermeira luta para proteger seus pacientes, e uma esposa recebe péssimas notícias.","air_date":"2025-01-31","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/sctw0e8uWmHAG4qcyX43G6PCrrA.jpg","vote_average":0},"5":{"name":"Volta Para Casa","overview":"Soldados voltam para uma América dividida e devem aceitar como a guerra os mudou. Crenças diferentes criam uma distância entre melhores amigos.","air_date":"2025-01-31","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/f80FVzraMLf86ftIg6kN4eAgrVc.jpg","vote_average":0},"6":{"name":"O Desfecho","overview":"Dez anos depois, em 1975, os americanos restantes e os sul-vietnamitas em fuga correm contra o tempo para escapar na maior evacuação com helicópteros de todos os tempos.","air_date":"2025-01-31","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/n7Tx53DVxb3nXje0gi4aT2M0JXO.jpg","vote_average":0}}}}},
