"129677":{"id":"129677","name":"Top Secret: OVNIS","slug":"top-secret-ovnis","original_title":"Top Secret UFO Projects Declassified","overview":"Há muitos anos, as alegações de contatos extraterrestres são desmentidas. Porém, muitos acreditam que a existência de OVNIs não só é provável, como real.","first_air_date":"2021-01-19","episode_run_time":45,"vote_average":7.2,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Petr Vachler"],"production_companies":[],"genres":["Documentário"],"certification":"10","backdrop_path":"https://image.tmdb.org/t/p/original/l6ZOctV4K6gfLRWf7jQQzNOLCtr.jpg","poster_path":"https://image.tmdb.org/t/p/original/eB5aBU9TVZ3Lk7G7Ppy6Ym0rtAd.jpg","cast":["Robert Polo"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/aDUVEZh1qPtN2AmLNUyqpk5nPFI.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/aDUVEZh1qPtN2AmLNUyqpk5nPFI.jpg","air_date":"2021-01-19","episode_count":6,"overview":"N/A","vote_average":9,"episodes":{"1":{"name":"Projeto Livro Azul: desconhecido","overview":"Depois da Segunda Guerra Mundial, a explosão no número de relatos de aparições de OVNIs leva o governo dos EUA a tentar controlar o fascínio do público por esses objetos.","air_date":"2021-01-19","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/vGyVT7O65ys6mVCkk8KO9F6zTZi.jpg","vote_average":9},"2":{"name":"O que a Casa Branca esconde?","overview":"Será mesmo que o governo americano criou uma organização secreta chamada MJ-12 para ocultar a verdade sobre os OVNIs? Alguns investigadores têm certeza que sim.","air_date":"2021-01-26","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/elB4czkM1Jc4fArhtz6GNXXyWst.jpg","vote_average":0},"3":{"name":"Codinome: Aurora","overview":"Alguns acreditam que o governo dos EUA mantém os incidentes com OVNIs em segredo para usar a sofisticada tecnologia alienígena a seu favor.","air_date":"2021-02-02","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/2hTZH2z4vQyXIa7gbolgzQETrmD.jpg","vote_average":0},"4":{"name":"Testemunhas","overview":"Documentos vazados e hackeados revelam que os governos mantêm informações sobre os OVNIs. Um homem alega ter participado de várias autópsias de alienígenas.","air_date":"2021-02-09","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/f0XliWKcUB0GSYiWJpw4rqk9qpf.jpg","vote_average":0},"5":{"name":"Segredos soviéticos","overview":"A Rússia também tem segredos com relação aos OVNIs, e alguns acreditam que a culpa é das armas nucleares. Mas nem todos os objetos não identificados vêm de cima.","air_date":"2021-02-16","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/zndYwn7yeiiV1LDn9IUVQLTLAhf.jpg","vote_average":0},"6":{"name":"Depois da revelação","overview":"Se os alienígenas realmente visitam a Terra, há quanto tempo isso acontece? E o que eles querem de nós?","air_date":"2021-02-23","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/cEwQS7133BYaKJnKAlXlspKKy5i.jpg","vote_average":0}}}}},
