"195635":{"id":"195635","name":"Minha Família em Jogo","slug":"minha-familia-em-jogo","original_title":"マイファミリー","overview":"Ele tem uma casa, uma esposa e uma filha pequena. No entanto, uma tragédia recai sobre este homem aparentemente feliz quando sua filha é sequestrada. Agora, o homem que pensava que tinha tudo enfrenta inúmeras provações e tribulações, e navega na complexa teia da natureza humana. A única maneira de salvar sua amada filha é eliminando a polícia e juntando-se a sua esposa para encontrar os sequestradores.","first_air_date":"2022-04-10","episode_run_time":45,"vote_average":6.1,"number_of_seasons":1,"number_of_episodes":10,"created_by":[],"production_companies":["TBS"],"genres":["Drama","Crime","Mistério"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/rVGWwYBuGLnaVbTIpnNE207PXVn.jpg","poster_path":"https://image.tmdb.org/t/p/original/nOXRbQmkDwUQDRib44HWuzdylDh.jpg","cast":["Kazunari Ninomiya","多部未華子","Miyū Ōshima","Kento Kaku","濱田岳"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/nOXRbQmkDwUQDRib44HWuzdylDh.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/nOXRbQmkDwUQDRib44HWuzdylDh.jpg","air_date":"2022-04-10","episode_count":10,"overview":"N/A","vote_average":7,"episodes":{"1":{"name":"Agora é a hora de proteger sua família!","overview":"Haruto Narusawa é o CEO da Harukana Online Games, a dissidente da indústria de videogames. Um dia, Haruto recebe um telefonema que muda sua vida. A pessoa que ligou sequestrou sua filha e exige um resgate de 500 milhões de ienes. Enquanto a polícia visita a casa de Haruto, ele recebe uma ligação de um funcionário sobre uma emergência no trabalho. Haruto não consegue organizar o resgate e ele pede ajuda a uma certa pessoa.","air_date":"2022-04-10","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/2cTxWAHcmJAJz5w06HomnynQCMR.jpg","vote_average":0},"2":{"name":"Reviravolta","overview":"Haruto Narusawa e sua esposa Michiru anunciam online o sequestro de sua filha, conquistando a simpatia do público. A polícia é criticada, e a corrida por notícias se intensifica. Quando o sequestrador exige o fim de todo envolvimento policial, Haruto e Michiru são forçados a agir contra a polícia, e os amigos do casal devem escolher um lado.","air_date":"2022-04-17","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/6sDct3kCuuwOI9jXeGJTNmOunan.jpg","vote_average":0},"3":{"name":"Devolvam minha filha!","overview":"Junto com os amigos da faculdade Miwa e Todo, Haruto e Michiru encerram o envolvimento da polícia e elaboram seu próprio plano e o compartilham com o sequestrador. Será que Haruto conseguirá salvar sua filha das garras do sequestrador?","air_date":"2022-04-24","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/bufdduTJGFxZ0jA2yOxuPSKvnoC.jpg","vote_average":0},"4":{"name":"O verdadeiro culpado","overview":"Ele tem uma casa, uma esposa e uma filha pequena. No entanto, uma tragédia recai sobre este homem aparentemente feliz quando sua filha é sequestrada. Agora, o homem que pensava que tinha tudo enfrenta inúmeras provações e tribulações, e navega na complexa teia da natureza humana.","air_date":"2022-05-01","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/zf23m01rtu511At6xxmtcBnEDi3.jpg","vote_average":0},"5":{"name":"Cúmplice! Surge a chave para a verdade.","overview":"Ele tem uma casa, uma esposa e uma filha pequena. No entanto, uma tragédia recai sobre este homem aparentemente feliz quando sua filha é sequestrada. Agora, o homem que pensava que tinha tudo enfrenta inúmeras provações e tribulações, e navega na complexa teia da natureza humana.","air_date":"2022-05-08","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/21npVYn8TOMY0LRRHWZ8bRU39D0.jpg","vote_average":0},"6":{"name":"A verdade: Suspeita de cumplicidade? Ficando cara a cara com o criminoso.","overview":"O sequestrador ataca novamente. Desta vez, o alvo é Misaki, filha de Akutsu e Eri. O criminoso designa Haruto como mensageiro, enquanto Katsuragi, agora afastado da investigação, não vê saída e faz uma jogada arriscada. Enquanto isso, Hanako percebe algo inquietante.","air_date":"2022-05-15","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/2FaZ59eOvqO6pz4TBoYScegbdEd.jpg","vote_average":0},"7":{"name":"Traição de um ente querido: você é o culpado?","overview":"O sequestrador foi descoberto! Haruto decide não informar a polícia para garantir a segurança de Misaki, entretanto ele suspeita que há um cúmplice. Miwa e Todo vão à casa de Haruto em busca da verdade, enquanto a polícia está secretamente atrás deles.","air_date":"2022-05-22","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/6ZBhWZEVnO94Rw9RDpgoahCa0wZ.jpg","vote_average":0},"8":{"name":"Capítulo final - A verdade por trás do sequestro: adeus, meu amor!","overview":"Todo faz uma confissão chocante, enquanto a história avança para seu capítulo final.","air_date":"2022-05-29","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/w20Re4byyALZfdG3Dy5ktnL7XYu.jpg","vote_average":0},"9":{"name":"Batalha final - O novo alvo do culpado","overview":"Uma figura-chave surge na investigação e o sequestrador mira no próximo alvo.","air_date":"2022-06-05","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/4FQn25xtwgNM1XCOHVU6OBkZlZ3.jpg","vote_average":7},"10":{"name":"Episódio final - A esperança de uma família para o futuro","overview":"Uma exigência é feita quando o motivo dos sequestros é revelado.","air_date":"2022-06-12","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/dAkyRTVimTKGbehrID70PEuxUq2.jpg","vote_average":0}}}}},
