"245021":{"id":"245021","name":"Consciência³","slug":"consciencia","original_title":"Consciência³","overview":"A série investiga o fenômeno da consciência. A investigação terá as seguintes abordagens: 1) neurológica: a consciência enquanto fenômeno bioquímico funcional do cérebro humano; 2) psicológica: a consciência enquanto fenômeno psíquico-existencial; 3) filosófica: a ciência da consciência. Em cada episódio, três renomados estudiosos tratarão de temas específicos ligados à consciência.","first_air_date":"2019-11-28","episode_run_time":0,"vote_average":0,"number_of_seasons":1,"number_of_episodes":5,"created_by":[],"production_companies":[],"genres":[],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/originalnull","poster_path":"https://image.tmdb.org/t/p/original/1C4NSnaPD7exAvYgwe5ADpVOmGY.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Primeira Temporada","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"2019-11-28","episode_count":5,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"A Consciência em Si","overview":"Neste episódio, nossos entrevistados expressam diferentes concepções da consciência ao longo da História e discorrem sobre o funcionamento desse misterioso atributo da Vida que, ao contrário do que professa a mentalidade antropocêntrica, não é uma exclusividade da nossa espécie, o Sapiens.","air_date":"2019-11-28","runtime":0,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"2":{"name":"A Consciência do Outro","overview":"Neste episódio, nossos entrevistados se debruçam sobre a que seria ter a consciência “do outro”, explanando sobre a necessidade da inclusão, as graves consequências da intolerância ao diferente e como a empatia é um marco na evolução da Vida.","air_date":"2019-12-05","runtime":0,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"3":{"name":"A Consciência na Rede da Vida","overview":"Neste terceiro episódio, traremos à tona a discussão sobre a importância de tomarmos consciência de que fazemos parte de uma intensa e complexa rede de interdependência da qual todos os seres – Sapiens ou não – fazem parte: a Rede da Vida.","air_date":"2019-12-12","runtime":0,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"A Consciência na Ciência","overview":"No quarto episódio da série, refletimos sobre o papel fundamental da consciência na Ciência, em especial em tempos de fundamentalismos de toda ordem. Para bem longe das proposições de “terra plana” e embasado pela mais contemporânea visão científica, confronta o Sapiens com o Cosmos.","air_date":"2019-12-19","runtime":0,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"5":{"name":"A Consciência de Gaia","overview":"Uma reflexão sobre o fenômeno universal da consciência. O quinto episódio debate a emergência de uma consciência planetária diante de um mundo cada vez mais intoxicado. Também ressalta o valor incalculável da Vida, a visão planetária e a potência da diversidade humana como essenciais para a preservação de um ecossistema sadio.","air_date":"2019-12-26","runtime":0,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
