"222674":{"id":"222674","name":"Ed Sheeran: A Soma de Tudo","slug":"ed-sheeran-a-soma-de-tudo","original_title":"Ed Sheeran: The Sum of It All","overview":"O astro mundial Ed Sheeran expõe sua vida com absoluta sinceridade nessa série documental.","first_air_date":"2023-05-03","episode_run_time":0,"vote_average":8.5,"number_of_seasons":1,"number_of_episodes":4,"created_by":[],"production_companies":["Fulwell 73 Productions"],"genres":["Documentário"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/9aBrOSfThT8cCyuqQssTEoZI2ky.jpg","poster_path":"https://image.tmdb.org/t/p/original/xKZadYf38muksxUUHzcOcTLjA6C.jpg","cast":["Ed Sheeran","Cherry Seaborn"],"trailer":"k-WyxO2i36k","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/xKZadYf38muksxUUHzcOcTLjA6C.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/xKZadYf38muksxUUHzcOcTLjA6C.jpg","air_date":"2023-05-03","episode_count":4,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Amor","overview":"Ed Sheeran compartilha como planejou sua evolução e teve determinação para trilhar o caminho do sucesso mundial. Ed fala de como se apaixonou por uma amiga antiga, Cherry, e compôs para ela a emblemática balada “Perfect”. Ed está no auge das conquistas, mas acontece algo inesperado. Cherry recebe uma notícia que muda sua vida, e Ed percebe que os planos podem se alterar de repente.","air_date":"2023-05-03","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/dyma542WY7P79CxAVozuS2pifKo.jpg","vote_average":0},"2":{"name":"Perda","overview":"Ed conta que se fixou na sua cidade natal para ficar mais perto dos amigos e da família. Ele apresenta o grupo de amigos de confiança que o ajudam a manter os pés no chão. Acontece o impensável quando seu amigo Jamal Edwards morre repentinamente, virando seu mundo do avesso. Ed reflete sobre o significado da amizade e usa a música como terapia, cantando com o amigo Stormzy e analisando o próprio legado.","air_date":"2023-05-03","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/1srCcPVciYk2ygqJWVZyddKBVhS.jpg","vote_average":0},"3":{"name":"Concentração","overview":"Ed mostra seu processo em cenas inéditas da criação do sucesso “Bad Habits”. A emoção é forte quando Ed finalmente começa o último capítulo do seu plano de cinco discos. Ed mergulha no trabalho e canta com Eminem numa apresentação histórica, mas Cherry tem medo de ele usar o trabalho como distração. Ed divulga músicas novas pela primeira vez e se deixa levar pela emoção.","air_date":"2023-05-03","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/m7JnGCzqNABChIwcqblSO4DY4q5.jpg","vote_average":0},"4":{"name":"Libertação","overview":"Enquanto Ed promove sua turnê nos EUA, ele e Cherry refletem sobre os desafios de equilibrar a família e o trabalho quando costumam ficar longe um do outro. Ed revela preocupações ao mostrar para o mundo seus pensamentos mais profundos em “Subtract”. Num tributo ao Jamal, Ed apresenta um rap em homenagem à amizade deles. Ed e Cherry recebem uma boa notícia sobre a saúde de Cherry e ficam otimistas para o futuro.","air_date":"2023-05-03","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/mjVB3cgSEoaS3ZvxhLH9wa1xiAT.jpg","vote_average":0}}}}},
